import React from 'react';
import { useNavigate } from 'react-router-dom';

import aboutside from '../assets/aboutside.jpg'
import shopside from '../assets/shopside.jpg'

const LandingBG = () => {
    const navigate = useNavigate();
    const handleLeftClick = () => navigate('/shop');
    const handleRightClick = () => navigate('/about');

    return (
        <div
            style={{
                height: '100vh',
                display: 'flex',
            }}
        >
            <div
                style={{
                    width: '100vw',
                    backgroundImage: `url(${shopside})`,
                    backgroundSize: "cover",
                    cursor: 'pointer',
                    backgroundRepeat: 'no-repeat',
                }}
                onClick={handleLeftClick}
            />
            <div
                style={{
                    width: '100%',
                    backgroundImage: `url(${aboutside})`,
                    backgroundSize: "cover",
                    cursor: 'pointer',
                    backgroundRepeat: 'no-repeat',
                }}
                onClick={handleRightClick}
            />
        </div>
      );
}


export default LandingBG;
